  namespace: Abatab
  summary: "\nLoad the settings from the local Web.config file.\n"
  remarks: "\n* Whenever a new value is added/removed to Properties/Settings.settings, it needs to be added/removed here as well.\n* Configuration settings details can be found <a href=\"https://spectrum-health-systems.github.io/Abatab/man/man-configuration-local-settings.html\">here.</a>\n* Settings are trimmed and converted to lowercase. <a href=\"https://spectrum-health-systems.github.io/Abatab/man/man-source-code-home.html/#casing-and-trimming\">[more info]</a>\n"
  example: []
  syntax:
    content: public static Dictionary<string, string> Load()
    return:
      type: System.Collections.Generic.Dictionary{System.String,System.String}
      description: A dictionary containing the settings from Web.config.
